{"name":"YEP_X_Autosave","status":true,"description":"v1.00 (Req YEP_SaveCore.js) Adds Autosave functionality to your\nRPG Maker game.","parameters":{"---Automatic---":"","OnMapLoad":"false","OnMainMenu":"false","---Option Menu---":"","Show Option":"true","Option Name":"Autosave","Default":"true","---Visual---":"","ShowAutosave":"true","AutosaveMsgSave":"Autosaved","AutosaveMsgLoad":"","MsgGradient1":"rgba(0,0,0,0)","MsgGradient2":"rgba(0,0,0,0)","MsgGradientCode":"\"var textWidth = this.textWidthEx(this.message());\\nvar half = this.textPadding() + Math.ceil(textWidth / 2);\\nvar height = this.lineHeight();\\nvar color1 = Yanfly.Param.AutosaveMsgColor1;\\nvar color2 = Yanfly.Param.AutosaveMsgColor2;\\nthis.contents.gradientFillRect(0, 0, half, height, color1, color2);\\nthis.contents.gradientFillRect(half, 0, this.width - half, height, color2, color1);\"","MsgX":"Graphics.boxWidth - 180","MsgY":"Graphics.boxHeight - this.fittingHeight(1) * 2","MsgDuration":"120","FadeSpeed":"16"}}
